ct.htm\">Contact</a></div></li>\r\n  </ul>\r\n</div>\r\n\r\n<script type=\"text/javascript\" src=\"menu3/mbjsmb35un.js\"></script><!-- end menu -->\n\n\n<div id=\"mainBG\">\n<div id=\"main\">\n\n<iframe width=\"500\" height=\"281\" src=\"images/tcolemanHPstandin.jpg\" frameborder=\"0\" scrolling=\"no\" allowfullscreen></iframe>\n\n\n\n<div id=\"videoText\">\n<h1>Every month I send out a new article<br> that addresses the top questions<br> and issues that clients and readers<br> are asking for help with.</h1>\n<b> To receive this free monthly newsletter, subscribe: </b>\n\n\n\n<div id=\"formBox\">\n<a href=\"freenewsletter.php#subscribe\">Subscribe</a>\n</form>\n</div> <!-- formBox  -->\n\n</div> <!-- videoText -->\n\n\n\n\n<div id=\"asFeatured\">\n<span style=\"color:#060;font-family:verdana,sans-serif;font-size:15px;\">As featured in</span>: The Washington Post, Psychology Today, The New York Times, NPR, Match, TooFab, TMZ, Star and People.\n</div> <!-- asFeatured -->\n\n<div id=\"clickBoxes\">\n <div class=\"clickBox\" id=\"box1\">\n  <p>Need<br>Dating Help?</p>\n  <p class=\"start\"><a href=\"needhelp-dating.php\">Get started ></a></p>\n </div> <!-- clickBox  -->\n <div class=\"clickBox\" id=\"box2\">\n  <p>Need<br>Break-up Help?</p>\n  <p class=\"start\"><a href=\"needhelp-breakup.php\">Get started ></a></p>\n </div> <!-- clickBox  -->\n <div class=\"clickBox\" id=\"box3\">\n  <p>Need<br>Relationship Help?</p>\n  <p class=\"start\"><a href=\"needhelp-relationship.php\">Get started ></a></p>\n </div> <!-- clickBox  -->\n <div class=\"clickBox\" id=\"box4\">\n  <p>Need<br>Help to move on?</p>\n  <p class=\"start\"><a href=\"needhelp-moveon.php\">Get started</a> ></p>\n </div> <!-- clickBox1  -->\n\n</div> <!-- clickboxes -->\n\n\n<div id=\"Rcol\">\n\n<div id=\"quiz\">\nAre you relationship ready?<br><a href=\"quiz02.htm\">Take this quiz</a>\n</div> <!-- quiz -->\n\n<img src=\"images/Rcol-articleLinks-allGold.png\" width=\"325\" height=\"400\" border=\"0\" alt=\"\" usemap=\"#map1\">\n</div> <!-- Rcol -->\n\n<MAP NAME=\"map1\">\n<AREA HREF=\"https://www.facebook.com/coachtoni.coleman\" ALT=\"Facebook\" TITLE=\"Facebook\" SHAPE=RECT COORDS=\"113,20,213,45\">\n<AREA HREF=\"https://twitter.com/CoachToni\" ALT=\"Twitter\" TITLE=\"Twitter\"   SHAPE=RECT COORDS=\"222,20,322,45\">\n<AREA HREF=\"article.php?id=51&vc=chemistry\" ALT=\"Friend Crush\" SHAPE=RECT COORDS=\"0,110,325,159\">\n<AREA HREF=\"article.php?id=134&vc=chemistry\" ALT=\"The 3 elements of chemistry\" SHAPE=RECT COORDS=\"0,166,325,215\">\n<AREA HREF=\"article.php?id=144&catid=5\" ALT=\"Cohabitate or Not\" SHAPE=RECT COORDS=\"0,223,325,272\">\n<AREA HREF=\"article.php?id=127&vc=compatibility\" ALT=\"Relationship Dealbreakers\" SHAPE=RECT COORDS=\"0,280,325,328\">\n<AREA HREF=\"article.php?id=58&catid=13\" ALT=\"Burying the Ghosts of Lost Love\" SHAPE=RECT COORDS=\"0,337,325,385\">\n</MAP>\n\n<div id=\"Lcol\">\n\n<div class=\"article\">\n<h1>What Men Really Want</h1>\r\n<p><img src=\"/cms/content/upload/fotolia_52122858.jpg\" alt=\"fotolia_52122858.jpg\" width=\"300\" /></p>\r\n<div class=\"teaser\">\r\n<p>There is a question that keeps getting asked over and  over again. It may be phrased in different ways, but the answer that is being  sought is always the same &rdquo;What qualities and attributes do men find most  attractive in women?&rdquo; <br /> <a href=\"/article.php?id=82&amp;catid=9&amp;vc=dating-help\">Read more...</a></p>\r\n</div><br clear=\"left\">\n</div> <!--  article -->\n\n<div class=\"article\">\n<h1>Online Prince - Offline Frog</h1>\r\n<p><img src=\"/cms/content/upload/fotolia_56161957.jpg\" alt=\"\" width=\"300\" /></p>\r\n<div class=\"teaser\">\r\n<p>\"Words are cheap.\" This old adage has taken on new meaning in the cyber world of hopeful meeting and virtual dating. Boy meets girl, they email, text, send pictures and links to social networking pages--and maybe even get to the point where they exchange phone numbers.... <br /> <a href=\"/article.php?id=86&amp;catid=7&amp;vc=online-dating-help\">Read more...</a></p>\r\n</div><br clear=\"left\">\n</div> <!--  article -->\n\n\n<div class=\"article\">\n<h1>Questions to Ask Before Saying \"I Do\"</h1>\r\n<p><img src=\"/cms/content/upload/fotolia_54606928.jpg\" alt=\"\" width=\"300\" /></p>\r\n<div class=\"teaser\">\r\n<p>Are you in love and perhaps discussing marriage? Maybe he or she has already proposed and you said yes. If so, you are probably excited about moving towards commitment and the new life it will bring--but how well do you really know the kind of husband/wife/father/mother/ friend and lifelong partner this person will be?...<br /> <a href=\"/article.php?id=121&amp;catid=5&amp;vc=compatibility\">Read more...</a></p>\r\n</div></p>\n<br clear=\"left\">\n</div> <!--  article -->\n\n<div class=\"article\">\n<h1>Divorce Proofing Your Relationship</h1>\r\n<p><img src=\"/cms/content/upload/fotolia_69875421.jpg\" alt=\"\" width=\"300\" /></p>\r\n<div class=\"teaser\">\r\n<p>It seems that a growing trend is upon us, the spike in divorce of those over 50. Once upon a time, we saw our 50's as a period of empty nesting, planning for retirement and a comfortable and secure time of intimacy. It was believed that with the challenging and stressful years of career building, child raising and each individual's growth and change behind them, a couple would be stronger and closer than at any time in their history.... <br /> <a href=\"/article.php?id=125&amp;catid=1\">Read more...</a></p>\r\n</div><br clear=\"left\">\n\n</div> <!--  article -->\n\n</div> <!-- Lcol -->\n\n\n\n\n</div> <!-- main -->\n\n<div id=\"footer\">\n<h4>\n| <a href=\"faq.htm\">FAQ</a> |\n<a href=\"site-survey.htm\">Site Services Survey</a> |\n<a href=\"relatedlinks.php\">Links</a> |\n</h4>\n\n<h1>\nConsum-mate<sup style=\"font-size:10px;\">SM</sup>: Relationship Help for Singles and Couples<br>\n703-847-1768  &bull;   <a href=\"mailto:toni@consum-mate.com\">toni@consum-mate.com</a>\n</h1></div> <!-- footer -->\n\n\n</div> <!-- mainBG -->\n\n\n\n</div> <!-- wrap -->\n\n\n\n\n\n\n\n\n\n\n<pre>\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n</pre>\n<div style=\"text-align:right;\"><a href=\"/cms\" class=\"nc_login_link\"><img src=\"/cms/system/images/key.png\" alt=\"Log In\" title=\"Log In\" border=\"0\"/></a></div>\n</body>\n</html>", "extracted_metadata": {"Rating": "General", "description": "Dating advice,relationship advice for singles.Relationship readiness, meeting and dating, achieving intimacy . Offers quiz, newsletter, personality profiling, resources and teleclasses. ", "Classification": "dating advice", "Content-Encoding": "windows-1252", "dc:title": "Consummate:Dating help for women and men and relationship help for committed and married couples", "Robot": "Index,ALL", "revisit-after": "15 Days", "Language": "en", "keywords": "dating advice for women,dating advice for men,dating advice,singles dating,relationship advice", "title": "Consummate:Dating help for women and men and relationship help for committed and married couples", "distribution": "Global", "Content-Type": "text/html; charset=windows-1252", "X-Parsed-By": "org.apache.tika.parser.DefaultParser"}, "version": "2.0", "extracted_text": "\n\n\n\n\n\n\n\n  \tHOME\n\n\tAbout\n\n\tBlog\n\n\tNewsletter\n\n\tArticles\n\n\n    \tDating Articles\n\tRelationship Articles\n\n\n\tColumns\n\n\n    \tDating Help\n\tRelationship Help\n\n\n\tFast Help\n\n\tMedia Room\n\n\tContact\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\nEvery month I send out a new article\n that addresses the top questions\n and issues that clients and readers\n are asking for help with.\n\n To receive this free monthly newsletter, subscribe: \n\n\n\n\nSubscribe\n\n\n \n\n\n \n\n\n\n\n\nAs featured in: The Washington Post, Psychology Today, The New York Times, NPR, Match, TooFab, TMZ, Star and People.\n\n \n\n\n \n  Need\nDating Help?\n\n  Get started >\n\n \n \n \n  Need\nBreak-up Help?\n\n  Get started >\n\n \n \n \n  Need\nRelationship Help?\n\n  Get started >\n\n \n \n \n  Need\nHelp to move on?\n\n  Get started >\n\n \n \n\n\n \n\n\n\n\n\nAre you relationship ready?\nTake this quiz\n\n \n\n\n\n \n\n\n\n\n\n\nWhat Men Really Want\n\n\n\n\nThere is a question that keeps getting asked over and  over again. It may be phrased in different ways, but the answer that is being  sought is always the same \u201dWhat qualities and attributes do men find most  attractive in women?\u201d \n Read more...\n\n\n\n\n\n \n\n\nOnline Prince - Offline Frog\n\n\n\n\n\"Words are cheap.\" This old adage has taken on new meaning in the cyber world of hopeful meeting and virtual dating. Boy meets girl, they email, text, send pictures and links to social networking pages--and maybe even get to the point where they exchange phone numbers.... \n Read more...\n\n\n\n\n\n \n\n\n\nQuestions to Ask Before Saying \"I Do\"\n\n\n\n\nAre you in love and perhaps discussing marriage? Maybe he or she has already proposed and you said yes. If so, you are probably excited about moving towards commitment and the new life it will bring--but how well do you really know the kind of husband/wife/father/mother/ friend and lifelong partner this person will be?...\n Read more...\n\n\n\n\n\n\n \n\n\nDivorce Proofing Your Relationship\n\n\n\n\nIt seems that a growing trend is upon us, the spike in divorce of those over 50. Once upon a time, we saw our 50's as a period of empty nesting, planning for retirement and a comfortable and secure time of intimacy. It was believed that with the challenging and stressful years of career building, child raising and each individual's growth and change behind them, a couple would be stronger and closer than at any time in their history.... \n Read more...\n\n\n\n\n\n\n \n\n\n \n\n\n\n\n\n \n\n\n\n| FAQ |\nSite Services Survey |\nLinks |\n\n\n\n\nConsum-mateSM: Relationship Help for Singles and Couples\n\n703-847-1768  \u2022   toni@consum-mate.com\n\n\n \n\n\n\n \n\n\n\n\n \n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\